window.bookSummaryJSON = "<p>From the Demon Accords universe come six stories that delve behind the curtains. How does the FBI respond to a potential werewolf attack in an awakened world? What is it like to grow up witch? What's in Wolf Pack Management 101? How do you assist a vampire queen? Who else lives on the world of Fairie? What does it take to prepare for alien invasion? As told by Declan, Stacia, Lydia, Chris, and introducing a few new characters to the fold. <i>DA Compendium 3 </i>builds upon and moves the arc of the DA storyline forward toward the battle for Earth. If you are a fan of the series you do not want to miss any of these important stories!</p>"; 
